class ProjectAddDocumentRequestModel {  int? manageProjectId;  String? fileName;  String? type;  String? path;  ProjectAddDocumentRequestModel(      {this.manageProjectId, this.fileName, this.type, this.path});  ProjectAddDocumentRequestModel.fromJson(Map<String, dynamic> json) {    manageProjectId = json['manage_project_id'];    fileName = json['file_name'];    type = json['type'];    path = json['path'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['manage_project_id'] = this.manageProjectId;    data['file_name'] = this.fileName;    data['type'] = this.type;    data['path'] = this.path;    return data;  }}